from unittest import TestCase
import os
import json
from pathlib import Path
from freezegun import freeze_time
from UC3MTravel import HotelManager
from UC3MTravel import HotelManagementException



class testRoomReservtionTests(TestCase):
    def setUp(self):
        # Crear archivos temporales de prueba para check-in y check-out
        self.check_in_file = "check_in_test.json"
        self.check_out_file = "check_out_test.json"

        # Escribir datos de prueba en el archivo de check-in
        with open(self.check_in_file, "w") as f:
            json.dump([{"_HotelStay__roomkey": "101", "_HotelStay__departure": "1704585600."}], f)

    def tearDown(self):
        # Eliminar archivos temporales despus de cada prueba
        for file in [self.check_in_file, self.check_out_file]:
            if Path(file).is_file():
                Path(file).unlink()

    def test1(self):
        "Camino a seguir considerando que no se encuentra el archivo de los check in"
        guest = HotelManager()
        #Se pasa un archivo de check in inexistente
        guest.check_in_file = "prueba.json"
        # Probar la salida
        with self.assertRaises(HotelManagementException) as error:
            guest.guestCheckout("101")
        self.assertEqual(error.exception.message, "Cdigo de habitacin no registrado.")


    def test2(self):
        "Camino a seguir considerando que el formato del archivo de los check in no es vlido"
        guest = HotelManager()
        guest.check_in_file = self.check_in_file
        guest.check_out_file = self.check_out_file
        # Escribir datos invlidos en el archivo de check-in
        with open(self.check_in_file, "w") as file:
            file.write("")
        data = {"_HotelStay__roomkey": "101", "_HotelStay__departure": "1704585600."}
        with open(self.check_in_file, "a", encoding="utf-8", newline="") as file:
            for i in range(2):
                json.dump(data, file, indent=4)
                file.write("\n")
        # Probar formato JSON invlido para el archivo de check-in
        with self.assertRaises(HotelManagementException) as error:
            guest.guestCheckout("101")
        self.assertEqual(error.exception.message, "JSON Decode Error - Formato JSON no vlido")

    def test3(self):
        "Camino a seguir considerando que no se encuentra el cdigo de la habitacin"
        guest = HotelManager()
        guest.check_in_file = self.check_in_file
        guest.check_out_file = self.check_out_file
        # Probar 'room_key' no registrada
        with self.assertRaises(HotelManagementException) as error:
            guest.guestCheckout("102")
        self.assertEqual(error.exception.message, "Cdigo de habitacin no registrado.")

    @freeze_time("14/6/2024")
    def test4(self):
        "Camino a seguir considerando que la fecha de salida no es vlida"
        guest = HotelManager()
        guest.check_in_file = self.check_in_file
        guest.check_out_file = self.check_out_file
        # Actualizar la fecha de salida a una fecha diferente a la actual
        with open(self.check_in_file, "w") as f:
            json.dump([{"_HotelStay__roomkey": "101", "_HotelStay__departure": "14/6/2024"}], f)
        # Probar fecha de salida invlida
        with self.assertRaises(HotelManagementException) as error:
            guest.guestCheckout("101")
        self.assertEqual(error.exception.message, "La fecha de salida no es vlida")

